        <h2>Get in touch </h2>
        <form action="" className="form_entity">
            {fromApi.map(formEle)}
            <button
        className="about_btn hero_btn"
        style={style}
        onMouseOver={herobtn_over}
        onMouseLeave={heobtn_leave}
        onClick={aboutClicked}
      >Submit
      </button>
        </form>
        
      </div>
    </div>
  );
};

export default Hire_me;
